import React from 'react'
import { items } from '../items'

export default class finalapp extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            items: [i]
        }
    }

    componentDidMount(){
        this.setState({items: items})
    }

    render(){
        return (
            <div >
              <detail key={this.state.items.id} title={this.state.items.title} />
            </div>
        )
    }
}

class Detail extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div>
                <h1>This is the title: {this.props.title}</h1>
            </div>
        )
    }
}
